import React from "react";

const Page = () => {
    return(
        <div className="lady-wraper" style={{width: '420px', paddingTop: '62px', marginLeft: '600px'}}>
            <div className="fixed-top" style={{width: '420px', zIndex: '9000', height: '62.171px', marginLeft: '650px'}}>
                <img src="https://w.ladicdn.com/s550x350/629a0b2bb9cb4f0020e11d7d/frame-2-20230907050412-nfxao.png" style={{width: '204.857px', height: '42.171px'}}></img>
            </div>
            <div style={{height: '697.99px', backgroundColor: 'red'}}></div>
        </div>
    )
}

export default Page
